import React from "react";
import "./NavBar.css";
const NavBar = () => {
  return (
    <div class="topnav" id="myTopnav">
      <a href="#">Favorites</a>
      <a href="#" class="active">
        Home
      </a>
    </div>
  );
};
export default NavBar;
